import React, { Component } from "react";

class When extends Component {
	render() {
		return (
			<div id="when" className="section-content section-dark">
				<h2>When</h2>
				<p>
					Monday
					<br />
					28 November 2022
				</p>
			</div>
		);
	}
}

export default When;
